from pydantic import Fieldfrom pyoaev.configuration import ConfigLoaderCollectorclass CollectorConfigOverride(ConfigLoaderCollector):    id: str = Field(        default="openaev_mitre_attack",        description="Collector unique identifier",    )    name: str = Field(        default="MITRE ATT&CK",        description="Collector display name",    )    icon_filepath: str | None = Field(        default="mitre_attack/img/icon-mitre-attack.png",        description="Path to the icon file",    )